import {DefaultLayout} from './Components/Layout/DefaultLayout'

function App() {
  return (
    <Router>
      <div className='App'>
        <Routes>
          {publicRoutes.map((route, index)=>{
            const Page = route.component
            let Layout = DefaultLayout
            if(route.Layout){
              Layout  = route.layout
            }
          })}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
